import React, { Component } from "react";
import Typography from "@material-ui/core/Typography";

class Background extends Component {
  render() {
    return (
      <React.Fragment style={{ backgroundImage: `url(require("bg.jpg"))` }}>
        <img src="bg.jpg" width={1366} alt=""></img>
        <Typography>
          CHLELA is a software development team in San Francisco, California We
          deploy a combination of highly experienced, highly skilled engineers
          in the US and remotely to deliver an affordable high quality software.
        </Typography>
      </React.Fragment>
    );
  }
}

export default Background;
